import React from 'react';
import '../App.css';
import './CollisionVisualizer.css';

export default class CollisionVisualizer extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            array: [],
            array2: [],
        }
    }

    componentDidMount() {
        const array = [];
        const array2 = [];

        for (let i = 0; i < 100; i++) {
            array.push(1);
            array2.push(1);
        }
        this.setState({array, array2});
    }

    render() {
        return (
            <div className="container">
                 <table id="test" className="array-container">
                    {array.map((value, idx) => (
                        <tr key={idx}>
                            {array2.ap((value, idx) => ( <th></th> ))}
                        </tr>
                    ))}
                </table>
            </div>
        );
    }
}
